import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import { ToastContainer, toast } from "react-toastify";
import signupImage from '../../assets/images/home/signup-Image.png';
import { Typography ,MenuItem ,Select,InputLabel ,FormControl   } from "@mui/material";
import styles from "./Signup.module.css";
const Signup = () => {
  const navigate = useNavigate();
    const [filterJobType, setFilterJobType] = useState(null);

  const [inputValue, setInputValue] = useState({
    email: "",
    password: "",
    role: "",
  });
  const { email, password , role } = inputValue;
  const handleOnChange = (e) => {
    const { name, value } = e.target;
    setInputValue({
      ...inputValue,
      [name]: value,
    });
  };

  const handleError = (err) =>
    toast.error(err, {
      position: "bottom-left",
    });
  const handleSuccess = (msg) =>
    toast.success(msg, {
      position: "bottom-right",
    });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const { data } = await axios.post(
        "http://localhost:8001/signup",
        {
          ...inputValue,
        },
        { withCredentials: true }
      );
      console.log("Response:", data); 
      const { success , message } = data;
      if (success) {
        handleSuccess(message);
        setTimeout(() => {
          if(role === "freelancer"){
            navigate("/desc");
          }
          else{
            navigate("/dashboardproducer");
          }          
        }, 1000);
  
      } else {
        handleError(message);
      }
    } catch (error) {
      console.log(error);
    }
    setInputValue({
      ...inputValue,
      email: "",
      password: "",
      role: "freelancer",
    });
  };

  return (
    <>
    <div>
       <img src={signupImage} alt="home" className="right-Image" /> 
    </div>
    <div className="form_container">
      <h2>Signup Account</h2>
      <Typography variant="h6">Job Type</Typography>
          <FormControl  className={styles.formElement}>
            <InputLabel htmlFor="filterJobType">Select Job Type</InputLabel>
            <Select
              labelId="filterJobType-label"
              id="filterJobType"
              value={Role}
              label="Select Job Type"
            >
              <MenuItem value="">All</MenuItem>
              <MenuItem value="fullTime">Full Time</MenuItem>
              <MenuItem value="partTime">Part Time</MenuItem>
              <MenuItem value="contract">Contract</MenuItem>
            </Select>
          </FormControl>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="email">Email</label>
          <input
            type="email"
            name="email"
            value={email}
            placeholder="Enter your email"
            onChange={handleOnChange}
          />
        </div>
        <div>
          <label htmlFor="password">Password</label>
          <input
            type="password"
            name="password"
            value={password}
            placeholder="Enter your password"
            onChange={handleOnChange}
          />
        </div>
        <button type="submit">Submit</button>
        <span>
          Already have an account? <Link to={"/login"}>Login</Link>
        </span>
      </form>
      <ToastContainer />
    </div>
  
    </>
  );
};

export default Signup;
